title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o15752.o15757.m1 -> o15820.m0 -> o15752.o15757.m2 -> o15820.m0
  o15752.o15757.m2 -> o15820.m0 -> o15752.o15757.m2
  o15820.m0 -> o15752.o15757.m2 -> o15820.m0

features:
  - inheritance
  - overriding
  - method
  - polymorphism

